import { BrowserRouter as Router } from "react-router-dom";
import Route from "react-router-dom/Route";
import React from "react";
import Home from "./screen/homeScreen/Homepage";
import SignInSide from "./screen/authentication/loginView/Login";
import Signup from "./screen/registeration/registrationView/Signup";
import Loginpage from "./screen/adminPage/profileDetails/viewProfile/Loginadmin";
import Filters from "./shared/filters/Filters";
import Cardgrid from "./shared/cardDetails/Cardsgrid";

import Contact from "./screen/homeScreen/Contact";
import Navbar from "./screen/homeScreen/Navbar";
import Profile from "./screen/adminPage/profileDetails/viewProfile/ProfilePage";

const Routers = () => {
  return (
    <Router>
      <div>
        <Route
          path="/"
          exact
          render={() => {
            return (
              <div>
                {/* <Homecontent /> */}
                <Home />
              </div>
            );
          }}
        />
        <Route
          path="/contact"
          exact
          render={() => {
            return (
              <div>
                <Navbar />
                <Contact />
              </div>
            );
          }}
        />

        <Route
          path="/login"
          exact
          render={() => {
            return (
              <div>
                <SignInSide />
              </div>
            );
          }}
        />

        <Route
          path="/signup"
          exact
          render={() => {
            return <Signup />;
          }}
        />

        <Route
          path="/loginpage"
          exact
          render={() => {
            return (
              <div>
                <Loginpage />
                <Filters />
                <Cardgrid />
              </div>
            );
          }}
        />
        <Route
          path="/profile"
          exact
          render={() => {
            return (
              <div>
                <Profile />
              </div>
            );
          }}
        />
      </div>
    </Router>
  );
};

export default Routers;
